// components/MapSection.js
import React from 'react';

const MapSection = () => {
  return (
    <section className="map-section">
  <div className="container mx-auto px-20">
    <a href="https://maps.google.com/?q=YourStoreLocation" target="_blank">
      {/* Added mb-4 for margin bottom. You can change the 4 to any number to increase/decrease the margin */}
      <img
        src="https://placehold.co/1866x725"
        alt="Location Map"
        className="w-full h-auto mb-12"
      />
    </a>
  </div>
</section>

  );
};

export default MapSection;
